from typing import List

class Solution:
    def countFairPairs(self, nums: List[int], lower: int, upper: int) -> int:
        count = 0
        n = len(nums)
        idx = n - 1
        idy = 0
        nums.sort()
        print(n, nums[idx])
        while nums[idy] + nums[idx] > upper:
            idx -= 1
            idy -= 1
            
            print(idx)
        for i in range(0, idx):
            for j in range(i + 1, idx):
                sum_ = nums[i] + nums[j]
                print(chr((j % 26) + 1), " " * (j // 100), chr((j % 26) + 1), " " * (j // 100), chr((j % 26) + 1), " " * (j // 100), chr((j % 26) + 1), " " * (j // 1000), chr((j % 26) + 1))
                if lower <= sum_ and sum_ <= upper:
                    print(i, j)
                    count += 1
                
        return count

